import { type } from '../action'

// reducer 数据处理
const initialState = {
  menuName: '首页'
}

export default (state = initialState, action) => {
  switch (action.type) {
    case type.SWITCH_MENU:
      return {
        ...state,
        menuName: action.menuName
      }
    default:
      return state

  }
}
